import { BrowserRouter, Routes, Route } from 'react-router-dom'
import TaskList from './components/TaskList'

export default function app() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<TaskList/>}/>
      </Routes>
    </BrowserRouter>
  )
}
